import { Link, Typography, Grid } from "@material-ui/core";
import { makeStyles } from "@material-ui/core";
import card from "../image/card.jpeg";
import React from "react";
const useStyles = makeStyles((theme) => ({
  card: {
    height: "100vh",
    // display: "flex",
    // justifyContent: "center",
    // justifyContent: "space-around",
    // alignItems: "center",
    // [theme.breakpoints.down("xs")]: {
    //   justifyContent: "center",
    // },
  },
  card1: {
    width: "217px",
    minHeight: "230px",
    maxHeight: "250px",
    border: "1px solid",
    borderRadius: "10px",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    [theme.breakpoints.down("xs")]: {
      width: "180px",
      minHeight: "200px",
      maxHeight: "200px",
    },
  },
  img1: {
    height: "120px",
    [theme.breakpoints.down("xs")]: {
      width: "150px",
    },
  },
  title1: {
    fontSize: "20px",
    paddingTop: "20px",
  },
  link: {
    textAlign: "center",
    color: "#000",
    "&:hover": {
      color: "blue",
    },
  },
}));

export default function ListCard() {
  const classes = useStyles();

  return (
    <Grid
      container
      spacing={2}
      // rowSpacing={1}
      columnSpacing={{ xs: 1, sm: 2, md: 3 }}
      // columns={{ xs: 2, md: 12 }}
      className={classes.card}
    >
      <Grid className={classes.card1}>
        <Link
          href="http://www.google.com"
          className={classes.link}
          underline="none"
        >
          <img src={card} alt="img1" className={classes.img1} />
          <Typography className={classes.title1}>Thẻ bài</Typography>
        </Link>
      </Grid>
      <Grid className={classes.card1}>
        <img src={card} alt="img1" className={classes.img1} />
        <Typography className={classes.title1}>Thẻ bài</Typography>
      </Grid>
      <Grid className={classes.card1}>
        <img src={card} alt="img1" className={classes.img1} />
        <Typography className={classes.title1}>Thẻ bài</Typography>
      </Grid>
      <Grid className={classes.card1}>
        <img src={card} alt="img1" className={classes.img1} />
        <Typography className={classes.title1}>Thẻ bài</Typography>
      </Grid>
    </Grid>
  );
}
